import React from 'react';

// material-ui
import { CardContent, FormControl, FormControlLabel, Grid, MenuItem, TextField, Radio, RadioGroup} from '@material-ui/core';

// project imports
import { gridSpacing } from 'store/constant';
import SubCard from 'ui-component/cards/SubCard';

const ClientSelect = () => {
    const [valueLabel, setValueLabel] = React.useState('checked');

    return (
        <Grid container spacing={gridSpacing}>
            <Grid item xs={12} sm={12} lg={8} md={8}>
                <TextField type='text' fullWidth label='Client' defaultValue='' />
            </Grid>

            <Grid item xs={12} md={6}>
                <SubCard title="Client Status">
                    <Grid container spacing={12}>
                        <Grid item xs={12} sm={12} lg={6} md={6}>
                            <FormControl>
                                <RadioGroup
                                    row
                                    aria-label="gender"
                                    value={valueLabel}
                                    onChange={(e) => setValueLabel(e.target.value)}
                                    name="row-radio-buttons-group"
                                >
                                    <FormControlLabel value="existing-extra-mural-no-reassess" control={<Radio />} label="Existing Extra-Mural Client â€“ No need to re-assess " />
                                    <FormControlLabel value="existing-extra-mural-reassess" control={<Radio />} label="Unchecked" />
                                    <FormControlLabel value="new-extra-mural" control={<Radio />} label="Unchecked" />
                                </RadioGroup>
                            </FormControl>
                        </Grid>
                    </Grid>
                </SubCard>
            </Grid>


        </Grid>
    );
};

export default ClientSelect;
